import VueRouter from "vue-router";

import AboutLearn from '../pages/AboutLearn.vue'
import AboutWork from '../pages/AboutWork.vue'
import AboutLife from '../pages/AboutLife.vue'
import LearningResource from '../pages/LearningResource.vue'

export default new VueRouter({
    routes:[
        {
            path:'/aboutlearn',
            component:AboutLearn
        },
        {
            path:'/aboutwork',
            component:AboutWork,
            children:[{
                path:'js',
                component:LearningResource
            }]
        },
        {
            path:'/aboutlife',
            component:AboutLife
        }
    ]
})
